Snow White And The 7 Dwarfs
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Once upon a time a bad Queen, was pretending to be the most beautiful woman of a kingdom. But her young step-daughter, Snow White was really better.. The rage of the bad Queen became very very hard, so she decided to eliminate the sweet Snow White for ever! The man-hunter who should have to kill the girl, didn't execute the misfit, because the beauty and the innocence of Snow White, touched the heart of the man, so he let's her escape. Running in the woods, she was lucky to find refuge in the house of seven adorable little dwarfs..

Cast: Ludmilla Antonova , Anita Szabo , Julia Dobler , Vicky , Sean Michaels , Julian St. Croix , Joe D'Amato,  Director

Categories: Cosplay Couples Fantasy Feature Foreign Historical / Period Piece Parody

